import React from "react";

export default class Results extends React.Component {
  constructor() {
    super();
    this.state = {
      name: 'Ali'
    }
  }

  render() {
    var data = require('./moviedata.json');
    var resultsstyles = {
      width: 'auto',
      float: 'left',
      color: 'black'
    }
    return (
      <div style={resultsstyles}>
        <h1>{this.state.name}</h1>
      </div>
    )
  }
}
